-- set the use_for_pace_calculation flag to true for activities
-- that have both duration and distance
update activity_detail
set use_for_pace_calculation = true
where activity_detail_type in ('duration', 'distance')
  and activity_id in (
    select a.activity_id
    from activity a
    where exists (
        select 1
        from activity_detail ad1
        where activity_detail_type = 'duration'
          and ad1.activity_id = a.activity_id
        group by ad1.activity_id
        having count(1) = 1
      )
      and exists (
        select 1
        from activity_detail ad2
        where activity_detail_type = 'distance'
          and ad2.activity_id = a.activity_id
        group by ad2.activity_id
        having count(1) = 1
      )
  );

