update public.activity
set pace_type =
  case
    when name in ('Run', 'Cycling', 'Hiking', 'Skiing') then 'minutesPerUom'::public.pace_type
    when name = 'Swim' then 'minutesPer100Uom'::public.pace_type
    when name = 'Rower' then 'minutesPer500m'::public.pace_type
    when name = 'Stairs' then 'floorsPerMinute'::public.pace_type
    else null
  end
where name in (
  'Run',
  'Cycling',
  'Swim',
  'Rower',
  'Hiking',
  'Stairs',
  'Skiing'
);

with user_days as (
  select *
  from (
    select
      user_id,
      generate_series(current_date - interval '500 days', current_date, interval '1 day')::date as day
    from public.profile
  ) x
  where random() >= 0.5
),
all_data as (
  select row_number() over(partition by ra.user_id, ra.day order by random()) as row_num,
    ra.user_id,
    ra.day,
    a.activity_id
  from user_days ra
    cross join public.activity a
)
select user_id,
       activity_id,
  day + (floor(random() * 24) || ' hours')::interval,
  day + (floor(random() * 24) || ' hours')::interval
from all_data
where row_num between 1 and 10 * random();

truncate table public.trending_activity;
select * from public.global_trending_activity();

on conflict (id) do update set public = true;
